import React, { useState, useEffect } from 'react';
import { createClient } from '@supabase/supabase-js';

const supabaseUrl = 'https://pkmnyoyvezizgqzycyuz.supabase.co';
const supabaseKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6InBrbW55b3l2ZXppemdxenljeXV6Iiwicm9sZSI6ImFub24iLCJpYXQiOjE3MjgyMjU4MDAsImV4cCI6MjA0MzgwMTgwMH0.le8V0aqC8jouFoUC-3XD9bCWqEPXsqInu9buiwzlpKU';
const supabase = createClient(supabaseUrl, supabaseKey);

const conditions = ['A', 'B', 'C'];
const vignettes = {
  'A': ['Vignette A1', 'Vignette A2', 'Vignette A3'],
  'B': ['Vignette B1', 'Vignette B2', 'Vignette B3'],
  'C': ['Vignette C1', 'Vignette C2', 'Vignette C3']
};
const questions = [
  {'id': 'q1', 'text': 'What is your opinion?', 'type': 'likert', 'options': ['Strongly Disagree', 'Disagree', 'Neutral', 'Agree', 'Strongly Agree']},
  {'id': 'q2', 'text': 'Please explain:', 'type': 'text'}
];

function App() {
  const [survey, setSurvey] = useState(null);
  const [currentVignetteIndex, setCurrentVignetteIndex] = useState(0);
  const [responses, setResponses] = useState({});
  const [isComplete, setIsComplete] = useState(false);
  const [respondentId, setRespondentId] = useState(null);

  useEffect(() => {
    assignCondition();
  }, []);

  const assignCondition = async () => {
    try {
      console.log('Starting assignCondition');
      // Get the current block
      let { data: blocks, error } = await supabase
        .from('blocks')
        .select('*')
        .order('created_at', { ascending: false })
        .limit(1);

      console.log('Blocks query result:', blocks);

      if (error) throw error;

      let currentBlock = blocks && blocks[0];

      if (!currentBlock || currentBlock.current_index >= conditions.length) {
        // Create a new block if needed
        const newBlock = shuffleArray([...conditions]);
        const { data, error: insertError } = await supabase
          .from('blocks')
          .insert({ conditions: newBlock, current_index: 0 })
          .select();

        if (insertError) throw insertError;

        currentBlock = data[0];
      }

      // Get the next condition and update the index
      const condition = currentBlock.conditions[currentBlock.current_index];
      const { error: updateError } = await supabase
        .from('blocks')
        .update({ current_index: currentBlock.current_index + 1 })
        .eq('id', currentBlock.id);

      if (updateError) throw updateError;

      // Record the assignment
      const { error: insertAssignmentError } = await supabase
        .from('condition_assignments')
        .insert({ condition });

      if (insertAssignmentError) throw insertAssignmentError;

      console.log('Setting survey with condition:', condition);
      setSurvey({
        condition,
        vignettes: vignettes[condition],
        questions
      });

      // Insert respondent
      const { data: respondentData, error: respondentError } = await supabase
        .from('respondents')
        .insert({
          condition: condition,
          submitted: false
        })
        .select('id')
        .single();

      if (respondentError) throw respondentError;

      setRespondentId(respondentData.id);
    } catch (error) {
      console.error('Error in assignCondition:', error);
      // Fallback to random assignment if there's an error
      const condition = conditions[Math.floor(Math.random() * conditions.length)];
      setSurvey({
        condition,
        vignettes: vignettes[condition],
        questions
      });
    }
  };

  const handleResponse = (questionId, response) => {
    setResponses(prev => ({
      ...prev,
      [currentVignetteIndex]: { ...prev[currentVignetteIndex], [questionId]: response }
    }));
  };

  const nextVignette = () => {
    if (currentVignetteIndex < survey.vignettes.length - 1) {
      setCurrentVignetteIndex(currentVignetteIndex + 1);
    } else {
      setIsComplete(true);
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      // First, get the respondent_id from the respondents table
      const { data: respondentData, error: respondentError } = await supabase
        .from('respondents')
        .insert({
          condition: survey.condition,
          submitted: true
        })
        .select('id')
        .single();

      if (respondentError) throw respondentError;

      // Now insert the survey response
      const { data, error } = await supabase
        .from('survey_responses')
        .insert({
          respondent_id: respondentData.id,
          response_data: responses
        });

      if (error) throw error;

      console.log('Survey submitted successfully:', data);
      // You might want to show a success message to the user here
    } catch (error) {
      console.error('Error submitting survey:', error);
      // You might want to show an error message to the user here
    }
  };

  if (!survey) return <div>Loading...</div>;

  return (
    <div className="App">
      <h1>Survey</h1>
      {!isComplete ? (
        <div>
          <p>{survey.vignettes[currentVignetteIndex]}</p>
          {survey.questions.map(question => (
            <div key={question.id}>
              <p>{question.text}</p>
              {question.type === 'likert' ? (
                question.options.map(option => (
                  <button key={option} onClick={() => handleResponse(question.id, option)}>{option}</button>
                ))
              ) : (
                <textarea onChange={(e) => handleResponse(question.id, e.target.value)} />
              )}
            </div>
          ))}
          <button onClick={nextVignette}>
            {currentVignetteIndex < survey.vignettes.length - 1 ? 'Next' : 'Finish'}
          </button>
        </div>
      ) : (
        <div>
          <p>Thank you for completing the survey. Click submit to record your responses.</p>
          <button onClick={handleSubmit}>Submit Survey</button>
        </div>
      )}
    </div>
  );
}

function shuffleArray(array) {
  for (let i = array.length - 1; i > 0; i--) {
    const j = Math.floor(Math.random() * (i + 1));
    [array[i], array[j]] = [array[j], array[i]];
  }
  return array;
}

export default App;
